import React from 'react';
import Section from "react-bulma-components/lib/components/section";
import Box from 'react-bulma-components/lib/components/box';
import Media from 'react-bulma-components/lib/components/media';
import Image from 'react-bulma-components/lib/components/image';
import Content from 'react-bulma-components/lib/components/content';
import '../App.css';
import { useQuery } from "react-query";
import { getBuild} from "../middlewares/services";

const MascaraBuild = () => {
  const { isLoading, error, data } = useQuery("build", getBuild);
  if (isLoading) return "Loading...";
  if (error) return "Oops! ";
  return (
    <Section>
      <Box>
      { data.map( element =>
        <Media>
          <Media.Item>
            {element.bottle ?
              <Content>
                <p>
                  <strong>{ element.bottle.name }</strong>
                  <small>{ element.bottle.thread }</small>
                  <small>{ element.bottle.depth }</small>
                </p>
                <br />
              </Content>
            : "" }
          </Media.Item>
          <Media.Item>
            {element.brush ?
              <Content>
                <p>
                  <strong>{ element.brush.brush }</strong>
                  <small>{ element.brush.brushLength }</small>
                  <small>{ element.brush.shaftDiameter }</small>
                </p>
                <br />
              </Content>
            : "" }
          </Media.Item>
          <Media.Item>
            {element.rod ?
              <Content>
                <p>
                  <strong>{ element.rod.name }</strong>
                  <small>{ element.rod.thread }</small>
                  <small>{ element.rod.brushDiameter }</small>
                </p>
                <br />
              </Content>
            : "" }
          </Media.Item>
          <Media.Item>
            {element.rod ?
              <Content>
                <p>
                  <strong>{ element.rod.name }</strong>
                  <small>{ element.rod.thread }</small>
                  <small>{ element.rod.brushDiameter }</small>
                </p>
                <br />
              </Content>
            : "" }
          </Media.Item>









        </Media>
        )}
      </Box>
    </Section>
  )
};

export default MascaraBuild;
